import React from "react";
import { Formik, Field, Form, ErrorMessage } from "formik";
import * as Yup from "yup";
import "./Home-page.css";
const books = [
  {
    bookTitle: "Book 1",
    bookAuthor: "Author 1",
    bookDescription: "Description 1",
  },
  {
    bookTitle: "Book 2",
    bookAuthor: "Author 2",
    bookDescription: "Description 2",
  },
  {
    bookTitle: "Book 3",
    bookAuthor: "Author 3",
    bookDescription: "Description 3",
  },
];

const HomePage: React.FC = () => {
  return (
    <div>
      <ul className="book-list">
        {books.map((book, index) => (
          <li className="book-list-item" key={index}>
            <img src="book-image-url" alt="Book Cover" className="book-cover" />
            <div className="book-details">
              <label htmlFor={`bookTitle${index}`} className="book-label">
                Book Title
              </label>
              <span id={`bookTitle${index}`} className="book-title">
                {book.bookTitle}
              </span>
              <label htmlFor={`bookAuthor${index}`} className="book-label">
                Book Author
              </label>
              <span id={`bookAuthor${index}`} className="book-author">
                {book.bookAuthor}
              </span>
              <label htmlFor={`bookDescription${index}`} className="book-label">
                Book Description
              </label>
              <span id={`bookDescription${index}`} className="book-description">
                {book.bookDescription}
              </span>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default HomePage;
